import React from 'react';

// Ultra simple test - just a colored div
const TestBackground = () => {
  return (
    <div 
      style={{ 
        position: 'fixed', 
        top: 0, 
        left: 0, 
        width: '100%', 
        height: '100%', 
        background: 'linear-gradient(135deg, rgba(0,243,255,0.1) 0%, rgba(191,0,255,0.1) 100%)',
        zIndex: -10,
        pointerEvents: 'none'
      }}
    >
      <div style={{ 
        position: 'absolute', 
        top: '50%', 
        left: '50%', 
        transform: 'translate(-50%, -50%)',
        color: '#00f3ff',
        fontSize: '24px',
        fontWeight: 'bold',
        opacity: 0.3
      }}>
        BACKGROUND TEST
      </div>
    </div>
  );
};

export default TestBackground;
